/* xg.c: Guile (and someday Ruby) bindings for gdk/gtk/pango, some of glib
 *   generated automatically from makexg.scm and xgdata.scm (included in the libxm tarball)
 *   needs xen.h
 *
 *   GDK_DISABLE_DEPRECATED and GTK_DISABLE_DEPRECATED are handled together
 *   GDK_ENABLE_BROKEN and GTK_ENABLE_BROKEN are handled together
 *   PANGO_ENABLE_ENGINE and PANGO_ENABLE_BACKEND are handled together, and may be removed later
 *
 *   other flags:
 *     HAVE_GTK_MENU_SET_ACCEL_PATH
 *
 * reference args are ignored if passed, resultant values are returned in a list, marked with "[]" in help strings
 *
 * added funcs:
 *    (xm-version) -> date string.
 *    (c-array->list arr len) derefs each member of arr, returning lisp list
 *    (list->c-array lst ctype) packages each member of list as c-type "type" returning (wrapped) c array
 *    (|GdkCursor #:optional type ref_count) -> GdkCursor struct
 *    (|GdkPoint #:optional x y) -> GdkPoint struct
 *    (|GdkRectangle #:optional x y width height) -> GdkRectangle struct
 *    (|GdkSegment #:optional x1 y1 x2 y2) -> GdkSegment struct
 *    (|GdkSpan #:optional x y width) -> GdkSpan struct
 *
 * omitted functions and macros:
 *     anything with a va_list or GtkArg* argument.  "..." args are ignored.
 *     most of the unusual keysym names
 *     all *_CLASS, *_IFACE macros
 *     deprecated macros that involve argument reordering
 *     deprecated struct field accessors, Pango struct field accessors
 *     win32-specific functions
 *
 * TODO:
 *     check out the g_signal handlers: GtkSignalFunc also GtkEmissionHook (gtk_signal_* should be ok)
 *     GdkEvent casts
 *     struct print, perhaps more struct instance creators
 *
 * HISTORY:
 *     11-Feb-02: initial version.
 */

